import { Buffer } from 'buffer';
import * as oasis from 'oasis-std';
export class UserInfo implements oasis.AbiEncodable {
    public name: string;
    public constructor(fields: { name: string }) {
        this.name = fields.name;
    }
    public abiEncode(encoder: oasis.Encoder) {
        oasis.abiEncode('string' as oasis.Schema, this.name, encoder);
    }
    public static abiDecode(decoder: oasis.Decoder): UserInfo {
        return new UserInfo({
            name: oasis.abiDecode('string' as oasis.Schema, decoder),
        });
    }
}
export module Error {
    export class PermissionDenied implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(0);
        }
        public static abiDecode(decoder: oasis.Decoder): PermissionDenied {
            return new PermissionDenied();
        }
    }
    export class UsernameTaken implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(1);
        }
        public static abiDecode(decoder: oasis.Decoder): UsernameTaken {
            return new UsernameTaken();
        }
    }
    export class InvalidToken implements oasis.AbiEncodable {
        public constructor() {}
        public abiEncode(encoder: oasis.Encoder) {
            encoder.writeU8(2);
        }
        public static abiDecode(decoder: oasis.Decoder): InvalidToken {
            return new InvalidToken();
        }
    }
    export function abiDecode(decoder: oasis.Decoder): Error {
        const variantId = decoder.readU8();
        return (Error as any).VARIANTS[variantId].abiDecode(decoder);
    }
    export const VARIANTS: Function[] = [
        PermissionDenied,
        UsernameTaken,
        InvalidToken,
    ];
    export function isVariant(obj: any): obj is Error {
        for (const variant of Error.VARIANTS) {
            if (obj instanceof variant) {
                return true;
            }
        }
        return false;
    }
}
export type Error =
    | Error.PermissionDenied
    | Error.UsernameTaken
    | Error.InvalidToken;
export class UserRegistry {
    public static BYTECODE =
        '';
    private constructor(
        readonly address: oasis.Address,
        private gateway: oasis.Gateway,
    ) {}
    public static async connect(
        address: oasis.Address,
        gateway: oasis.Gateway,
    ): Promise<UserRegistry> {
        return new UserRegistry(address, gateway);
    }
    public static async deploy(
        gateway: oasis.Gateway,
        options?: oasis.DeployOptions,
    ): Promise<UserRegistry> {
        const payload = UserRegistry.makeDeployPayload();
        try {
            const deployedAddr = await gateway.deploy(payload, options);
            return new UserRegistry(deployedAddr, gateway);
        } catch (e) {
            throw e;
        }
    }
    public static makeDeployPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8Array(Buffer.from(UserRegistry.BYTECODE, 'base64'));
        return encoder.finish();
    }
    public async register(
        { name, loginCredential }: { name: string; loginCredential: string },
        options?: oasis.RpcOptions,
    ): Promise<void> {
        const payload = UserRegistry.makeRegisterPayload(name, loginCredential);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return;
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeRegisterPayload(
        name: string,
        loginCredential: string,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(0);
        return oasis.abiEncode(
            ['string' as oasis.Schema, 'string' as oasis.Schema],
            [name, loginCredential],
            encoder,
        );
    }
    public async signIn(
        {
            name,
            loginCredential,
            audience,
        }: { name: string; loginCredential: string; audience: oasis.Address },
        options?: oasis.RpcOptions,
    ): Promise<string> {
        const payload = UserRegistry.makeSignInPayload(
            name,
            loginCredential,
            audience,
        );
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('string' as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeSignInPayload(
        name: string,
        loginCredential: string,
        audience: oasis.Address,
    ): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(1);
        return oasis.abiEncode(
            [
                'string' as oasis.Schema,
                'string' as oasis.Schema,
                oasis.Address as oasis.Schema,
            ],
            [name, loginCredential, audience],
            encoder,
        );
    }
    public async verifyToken(
        { token }: { token: string },
        options?: oasis.RpcOptions,
    ): Promise<UserInfo> {
        const payload = UserRegistry.makeVerifyTokenPayload(token);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode(UserInfo as oasis.Schema, res);
        } catch (e) {
            if (e instanceof oasis.RpcError.Execution) {
                throw oasis.abiDecode(Error as oasis.Schema, e[0]);
            }
            throw e;
        }
    }
    private static makeVerifyTokenPayload(token: string): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(2);
        return oasis.abiEncode(['string' as oasis.Schema], [token], encoder);
    }
}
